  const paroisses = useSelector((state) => state.paroisses);
  const newArr = [];

  newArr.push(paroisses.filter((paroiss) => paroiss.name.includes(textSearch)));

  useEffect(() => {
    console.log(newArr);
  }, [newArr]);

  return <div className="search-list-container">List</div>;
};

